(function(){var loadHandler=window['sl_{8800508C-586C-412E-96F7-4011709AF3FB}'];loadHandler&&loadHandler(12, '<div id="spr0_35ff9bc"><div id="spr1_35ff9bc" class="kern slide"><img id="img3_35ff9bc" src="data:image/png;base64," width="960px" height="540px" alt="" style="left:0px;top:0px;"/><div id="spr3_35ff9bc" style="left:-9.14px;top:-1.345px;"><div id="svg0_35ff9bc" style="left:9.14px;top:1.061px;"><svg width="1280" height="83" viewBox="0 0 1280 83"><path fill="#d9d9d9" d="M0,0 h1280 v82.161 h-1280 Z"/></svg></div><div id="svg1_35ff9bc" style="left:104.609px;top:2.508px;"><svg width="1687" height="78" viewBox="0 0 1687 78"><path fill="none" d="M0,0 h1686.531 v77.558 h-1686.531 Z"/></svg></div><div id="spr4_35ff9bc" style="left:90.352px;top:0px;"><div id="svg3_35ff9bc" style="left:0px;top:0px;"><svg width="83" height="82" viewBox="0 0 83 82"><g fill="none"><path fill="#ffffff" d="M0,81.616 L41.287,0 L82.574,81.616 Z"/></g></svg></div></div><div id="spr5_35ff9bc" style="top:23.068px;"><div id="spr6_35ff9bc"><img id="img0_35ff9bc" src="data:image/png;base64," width="66" height="39" alt="" style="left:0.14px;top:-0.23px;"/></div></div></div><div id="spr7_35ff9bc" style="left:-346.652px;top:500.522px;"><div id="spr8_35ff9bc"><img id="img1_35ff9bc" src="data:image/png;base64," width="1653" height="39" alt="" style="left:0.152px;top:0.239px;"/></div></div></div><div id="spr2_35ff9bc" class="kern slide"><div id="spr9_35ff9bc" style="left:96px;top:-1.345px;"><div style="width:0px;"><span id="txt0_35ff9bc" data-width="319.042969" style="left:7.2px;top:13.957px;">Hydraulic Jacks</span></div></div><div id="spr10_35ff9bc" style="left:48px;top:126px;"><div style="width:0px;"><span id="txt1_35ff9bc" class="nokern relpos" dir="auto" style="left:7.2px;top:1.964px;">•</span> <span id="txt2_35ff9bc" class="relpos" data-width="383.519531" style="left:27.898px;top:-0.572px;">If a firm foundation is not available, the base of the</span></div><div style="width:0px;"><span id="txt3_35ff9bc" data-width="364.412109" style="left:34.2px;top:18.868px;">jack must be blocked. If there is a possibility that</span></div><div style="width:0px;"><span id="txt4_35ff9bc" data-width="365.291016" style="left:34.2px;top:38.308px;">the cap will slip, a block must be placed between</span></div><div style="width:0px;"><span id="txt5_35ff9bc" data-width="157.763672" style="left:34.2px;top:57.748px;">the load and the cap,</span></div><div style="width:0px;"><span id="txt6_35ff9bc" class="nokern relpos" dir="auto" style="left:7.2px;top:84.044px;">•</span> <span id="txt7_35ff9bc" class="relpos" data-width="322.576172" style="left:27.898px;top:81.508px;">The operator must keep an eye on the stop</span></div><div style="width:0px;"><span id="txt8_35ff9bc" data-width="354.208008" style="left:34.2px;top:100.948px;">indicator, which must be kept clean, in order to</span></div><div style="width:0px;"><span id="txt9_35ff9bc" data-width="383.167969" style="left:34.2px;top:120.388px;">determine the travel limit. The indicated limit must</span></div><div style="width:0px;"><span id="txt10_35ff9bc" data-width="128.610352" style="left:34.2px;top:139.828px;">not be exceeded.</span></div><div style="width:0px;"><span id="txt11_35ff9bc" class="nokern relpos" dir="auto" style="left:7.2px;top:166.124px;">•</span> <span id="txt12_35ff9bc" class="relpos" data-width="379.801758" style="left:27.898px;top:163.588px;">After the load is raised, it must be secured at once,</span></div><div style="width:0px;"><span id="txt13_35ff9bc" class="nokern relpos" dir="auto" style="left:7.2px;top:189.884px;">•</span> <span id="txt14_35ff9bc" class="relpos" data-width="371.812500" style="left:27.898px;top:187.348px;">Antifreeze will be supplied in adequate quantities</span></div><div style="width:0px;"><span id="txt15_35ff9bc" data-width="350.094727" style="left:34.2px;top:206.788px;">for hydraulic jacks that are exposed to freezing</span></div><div style="width:0px;"><span id="txt16_35ff9bc" data-width="107.129883" style="left:34.2px;top:226.228px;">temperatures,</span></div><div style="width:0px;"><span id="txt17_35ff9bc" class="nokern relpos" dir="auto" style="left:7.2px;top:252.524px;">•</span> <span id="txt18_35ff9bc" class="relpos" data-width="344.997070" style="left:27.898px;top:249.988px;">Jacks must be well-lubricated according to the</span></div><div style="width:0px;"><span id="txt19_35ff9bc" data-width="331.628906" style="left:34.2px;top:269.428px;">manufacturer’s recommendations at regular</span></div><div style="width:0px;"><span id="txt20_35ff9bc" data-width="69.591797" style="left:34.2px;top:288.868px;">intervals.</span></div></div><div id="spr11_35ff9bc" style="left:488px;top:163.208px;"><div id="spr12_35ff9bc"><img id="img2_35ff9bc" src="data:image/png;base64," width="424" height="282" alt="" style="top:-0.02px;"/></div></div></div></div>', '{"s":[]}');})();